import React from 'react';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';
import { Container, Paper } from '@mui/material';
import Button from '@mui/material/Button';
import TableContainer from '@mui/material/TableContainer';
import { Link } from 'react-router-dom';
import '../index.css';

const criterias = [
  {
    value: 'description',
    label: 'Description',
  },
  {
    value: 'author',
    label: 'Author',
  },
];

export default function Data() {
  const myStyle = {
    backgroundImage:
      "url('https://wallpapercave.com/wp/wp4748437.jpg')",
    // backgroundColor: "#eb8934",
    backgroundSize: 'cover',
    backgroundRepeat: 'repeat',
  }
  var description = ""
  var author = ""
  const [Search, setSearch] = React.useState('')
  const [Keyword, setKeyword] = React.useState('')
  const [searchResults, setSearchResults] = React.useState([])
  const handleClick = (e) => {
    if (Search) {
      if (Keyword === "description") {
        description = Search;
        author = '';
      } else {
        author = Search;
        description = '';
      }
      const url = `http://localhost:8080/search?author=${author}&description=${description}`;
      fetch(url)
        .then(response => response.json())
        .then(data => {
          setSearchResults(data);
        })
        .catch(error => {
          console.error('Error fetching search results:', error);
        });
    }

  };

  return (
    <Container>
      <div style={{margin : '3cm'}}>
        <h1
          style={{ fontFamily: 'sans-serif', fontSize: '2em' }}
        > Search the Database</h1>
        <p>Searching for the {Keyword} named {Search}</p>
        <form
          component="form"
          noValidate
          autoComplete="off"
        >
          <TextField
            id="filled-select-currency"
            style={{ marginRight: '0.5em', width: '10vw' }}
            select
            label="Select"
            defaultValue="Keywords"
            helperText="Search Category"
            variant="filled"
            value={Keyword}
            onChange={(e) => setKeyword(e.target.value)}
          >
            {criterias.map((option) => (
              <MenuItem key={option.value} value={option.value}>
                {option.label}
              </MenuItem>
            ))}
          </TextField>
          <TextField
            required
            id="filled-required"
            style={{ width: '50vw' }}
            label="Required"
            variant="filled"
            value={Search}
            onChange={(e) => setSearch(e.target.value)}
          />
        </form>
        <div
          style={{
            display: 'grid',
            gridTemplateColumns: '0.5fr 0.5fr 1fr',
            marginTop: '2em',
            marginLeft: '5em'
          }}
        >
          <Button variant="contained" disabled={!{ Search }} onClick={handleClick}
            style={{ width: 'fit-content', margin: '2em' }}
          >
            Search
          </Button>
        </div>
      </div>

      <div>
        {searchResults.map((result) => (
          <div key={result.id} className="box-container">
            {/* Render the content of each Data object */}
            <TableContainer component={Paper} sx={{ maxWidth: '30vw', margin: 'auto', marginBottom: '2em' }}>
              <Link to={`/details/${result.id}`}>
                <table sx={{ minWidth: 650 }} aria-label="simple table">
                  <thead>
                    <tr><th colspan="2">{result.id}</th></tr>
                  </thead>
                  <tbody>
                    <tr>
                      <td><strong>Author</strong></td>
                      <td><span style={{ fontSize: '1em', }}>
                        {result.author}</span></td>
                    </tr>
                    <tr>
                      <td><strong>Department</strong></td>
                      <td><span style={{ fontSize: '1em', }}>
                        {result.menu.application.function.department.departmentName}</span></td>
                    </tr>
                    <tr>
                      <td><strong>Function</strong></td>
                      <td><span style={{ fontSize: '1em', }}>
                        {result.menu.application.function.functionName}</span></td>
                    </tr>
                    <tr>
                      <td><strong>Application</strong></td>
                      <td><span style={{ fontSize: '1em', }}>
                        {result.menu.application.applicationName}</span></td>
                    </tr>
                    <tr>
                      <td><strong>Menu</strong></td>
                      <td><span style={{ fontSize: '1em', }}>{result.menu.menuName}</span></td>
                    </tr>
                    <tr>
                      <td><strong>Description</strong></td>
                      <td><span style={{ fontSize: '1em', }}>{result.description}</span></td>
                    </tr>
                  </tbody>
                </table>
              </Link>
            </TableContainer>

          </div>
        ))}
      </div>
      <div style={{ height: "30px" }} />
    </Container>

  );
}
